import React from "react";

function About() {
  return (
    <section className="p-10">
      <h2 className="text-3xl font-bold">About Us</h2>
      <p className="mt-4">
        Bela's Paw's is run by two brothers who started fostering dogs during lockdown.
        They rescued over 25-30 dogs across Pune with the support of PFA organization.
        Their journey inspired them to create a safe, loving hostel for pets.
      </p>
    </section>
  );
}
export default About;
